gMz(){return"The Codex Ephraemi Rescriptus is a palimpsest manuscript of the Greek Bible, written on parchment. It consists of 209 leaves, measuring approximately 33 x 27 cm, with 145 leaves belonging to the New Testament and 64 to the Old Testament."},
gMA(){return"The text is written in medium-sized uncial script in Greek, arranged in a single column per page with 40-46 lines per column. The codex follows scriptio continua without word separation, using only a single point for punctuation, and features enlarged letters at the beginning of sections protruding into the margin. The manuscript includes nomina sacra contracted into three-letter forms."},
gMy(){return"The manuscript was brought to Florence by an \xe9migr\xe9 scholar after the fall of Constantinople in 1453, and then transported to France in the 16th century by Catherine de' Medici. The oldest biblical text was first noticed by Pierre Allix, a Protestant pastor, in the early 18th century. Various scholars occasionally made excerpts from the manuscript, but Tischendorf was the first to read it in its entirety in 1845."},
gMu(){return"From a textological perspective, the codex primarily represents the Alexandrian text-type, although its affiliation varies across different books of the New Testament. Kurt Aland classified it as a Category II manuscript in his New Testament manuscript text classification system."},
