gNz(){return"\u0420\u0443\u043a\u043e\u043f\u0438\u0441\u044c \u043f\u0440\u0438\u0432\u043b\u0435\u043a\u043b\u0430 \u0432\u043d\u0438\u043c\u0430\u043d\u0438\u0435 \u0443\u0447\u0451\u043d\u044b\u0445 \u0432 1899 \u0433\u043e\u0434\u0443, \u043a\u043e\u0433\u0434\u0430 \u0431\u044b\u043b\u0430 \u0441\u0444\u043e\u0442\u043e\u0433\u0440\u0430\u0444\u0438\u0440\u043e\u0432\u0430\u043d\u0430 \u041a\u0438\u0440\u0441\u043e\u043f\u043e\u043c \u041b\u0435\u0439\u043a\u043e\u043c \u0432 \u043c\u043e\u043d\u0430\u0441\u0442\u044b\u0440\u0435 \u041f\u0430\u043d\u0442\u043e\u043a\u0440\u0430\u0442\u043e\u0440 \u043d\u0430 \u0410\u0444\u043e\u043d\u0441\u043a\u043e\u0439 \u0433\u043e\u0440\u0435."},
