gMk(){return"\u0420\u0443\u043a\u043e\u043f\u0438\u0441 \u0432\u0438\u043a\u043e\u043d\u0430\u043d\u0438\u0439 \u0443 \u0444\u043e\u0440\u043c\u0430\u043b\u044c\u043d\u043e\u043c\u0443 \u0443\u043d\u0446\u0456\u0430\u043b\u044c\u043d\u043e\u043c\u0443 \u043f\u043e\u0447\u0435\u0440\u043a\u0443 (\u0431\u0456\u0431\u043b\u0456\u0439\u043d\u0438\u0439 \u043c\u0430\u044e\u0441\u043a\u0443\u043b) \u0433\u0440\u0435\u0446\u044c\u043a\u043e\u044e \u043c\u043e\u0432\u043e\u044e \u0456\u0437 \u0437\u0430\u0441\u0442\u043e\u0441\u0443\u0432\u0430\u043d\u043d\u044f\u043c scriptio continua (\u0431\u0435\u0437 \u043f\u0440\u043e\u0431\u0456\u043b\u0456\u0432 \u043c\u0456\u0436 \u0441\u043b\u043e\u0432\u0430\u043c\u0438). \u0422\u0435\u043a\u0441\u0442 \u0440\u043e\u0437\u0442\u0430\u0448\u043e\u0432\u0430\u043d\u0438\u0439 \u0443 \u0441\u0442\u043e\u0432\u043f\u0446\u044f\u0445: \u0447\u043e\u0442\u0438\u0440\u0438 \u0441\u0442\u043e\u0432\u043f\u0446\u0456 \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0443 \u0432 \u041d\u043e\u0432\u043e\u043c\u0443 \u0417\u0430\u043f\u043e\u0432\u0456\u0442\u0456 \u0442\u0430 \u0434\u0432\u0430 \u2013 \u0443 \u043f\u043e\u0435\u0442\u0438\u0447\u043d\u0438\u0445 \u0442\u0435\u043a\u0441\u0442\u0430\u0445 \u0412\u0435\u0442\u0445\u043e\u0433\u043e \u0417\u0430\u043f\u043e\u0432\u0456\u0442\u0443. \u0423 \u043a\u043e\u0434\u0435\u043a\u0441\u0456 \u0440\u0435\u0442\u0435\u043b\u044c\u043d\u043e \u043f\u0440\u043e\u0434\u0443\u043c\u0430\u043d\u0456 \u0440\u043e\u0437\u0440\u0438\u0432\u0438 \u0440\u044f\u0434\u043a\u0456\u0432, \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u044e\u0442\u044c\u0441\u044f nomina sacra \u0442\u0430 \u0441\u043f\u0435\u0446\u0438\u0444\u0456\u0447\u043d\u0430 \u043f\u0443\u043d\u043a\u0442\u0443\u0430\u0446\u0456\u044f."},
gMi(){return"\u041a\u043e\u0434\u0435\u043a\u0441 \u0431\u0443\u043b\u043e \u0432\u0438\u044f\u0432\u043b\u0435\u043d\u043e 1844 \u0440\u043e\u043a\u0443 \u0432 \u043c\u043e\u043d\u0430\u0441\u0442\u0438\u0440\u0456 \u0421\u0432\u044f\u0442\u043e\u0457 \u041a\u0430\u0442\u0435\u0440\u0438\u043d\u0438 \u043d\u0430 \u0421\u0438\u043d\u0430\u0439\u0441\u044c\u043a\u043e\u043c\u0443 \u043f\u0456\u0432\u043e\u0441\u0442\u0440\u043e\u0432\u0456 \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043c \u0444\u043e\u043d \u0422\u0456\u0448\u0435\u043d\u0434\u043e\u0440\u0444\u043e\u043c."},
gMe(){return"\u0417 \u0442\u043e\u0447\u043a\u0438 \u0437\u043e\u0440\u0443 \u0442\u0435\u043a\u0441\u0442\u043e\u043b\u043e\u0433\u0456\u0457, \u0421\u0438\u043d\u0430\u0439\u0441\u044c\u043a\u0438\u0439 \u043a\u043e\u0434\u0435\u043a\u0441 \u043d\u0430\u043b\u0435\u0436\u0438\u0442\u044c \u0434\u043e \u0430\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e \u0442\u0438\u043f\u0443 \u0442\u0435\u043a\u0441\u0442\u0443 \u0439 \u043a\u043b\u0430\u0441\u0438\u0444\u0456\u043a\u0443\u0454\u0442\u044c\u0441\u044f \u044f\u043a \u041a\u0430\u0442\u0435\u0433\u043e\u0440\u0456\u044f I \u0441\u0435\u0440\u0435\u0434 \u0440\u0443\u043a\u043e\u043f\u0438\u0441\u0456\u0432 \u041d\u043e\u0432\u043e\u0433\u043e \u0417\u0430\u043f\u043e\u0432\u0456\u0442\u0443."},
gMg(){return"\u041d\u0430\u0440\u0430\u0437\u0456 \u0447\u0430\u0441\u0442\u0438\u043d\u0438 \u043a\u043e\u0434\u0435\u043a\u0441\u0443 \u0437\u0431\u0435\u0440\u0456\u0433\u0430\u044e\u0442\u044c\u0441\u044f \u0432 \u043a\u0456\u043b\u044c\u043a\u043e\u0445 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u0430\u0445: \u043e\u0441\u043d\u043e\u0432\u043d\u0430 \u0447\u0430\u0441\u0442\u0438\u043d\u0430 \u2013 \u0443 \u0411\u0440\u0438\u0442\u0430\u043d\u0441\u044c\u043a\u0456\u0439 \u0431\u0456\u0431\u043b\u0456\u043e\u0442\u0435\u0446\u0456 (\u041b\u043e\u043d\u0434\u043e\u043d), \u0430 \u0442\u0430\u043a\u043e\u0436 \u0443 \u0431\u0456\u0431\u043b\u0456\u043e\u0442\u0435\u0446\u0456 \u041b\u0435\u0439\u043f\u0446\u0438\u0437\u044c\u043a\u043e\u0433\u043e \u0443\u043d\u0456\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0443, \u043c\u043e\u043d\u0430\u0441\u0442\u0438\u0440\u0456 \u0421\u0432\u044f\u0442\u043e\u0457 \u041a\u0430\u0442\u0435\u0440\u0438\u043d\u0438 (\u0421\u0438\u043d\u0430\u0439) \u0442\u0430 \u0420\u043e\u0441\u0456\u0439\u0441\u044c\u043a\u0456\u0439 \u043d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0456\u0439 \u0431\u0456\u0431\u043b\u0456\u043e\u0442\u0435\u0446\u0456 (\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433)."},
gMt(){return"\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0439\u0441\u044c\u043a\u0438\u0439 \u043a\u043e\u0434\u0435\u043a\u0441 (A 02)"},
