gNc(){return"\u041f\u043e\u0440\u0444\u0456\u0440\u0456\u0430\u043d\u0441\u044c\u043a\u0438\u0439 \u043a\u043e\u0434\u0435\u043a\u0441 \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u0438\u0439 \u043d\u0430 \u043f\u0435\u0440\u0433\u0430\u043c\u0435\u043d\u0442\u0456 \u0442\u0430 \u0441\u043a\u043b\u0430\u0434\u0430\u0454\u0442\u044c\u0441\u044f \u0437 327 \u0430\u0440\u043a\u0443\u0448\u0456\u0432 \u0440\u043e\u0437\u043c\u0456\u0440\u043e\u043c \u043f\u0440\u0438\u0431\u043b\u0438\u0437\u043d\u043e 16 \xd7 13 \u0441\u043c. \u0426\u0435 \u043f\u0430\u043b\u0456\u043c\u043f\u0441\u0435\u0441\u0442, \u0449\u043e \u043c\u0456\u0441\u0442\u0438\u0442\u044c \u043a\u043e\u043c\u0435\u043d\u0442\u0430\u0440 \u0404\u0432\u0444\u0430\u043b\u0456\u044f \u0434\u043e \u0414\u0456\u044f\u043d\u044c \u0442\u0430 \u043f\u043e\u0441\u043b\u0430\u043d\u044c \u041f\u0430\u0432\u043b\u0430 \u043f\u043e\u0440\u044f\u0434 \u0456\u0437 \u0431\u0456\u0431\u043b\u0456\u0439\u043d\u0438\u043c \u0442\u0435\u043a\u0441\u0442\u043e\u043c."},
